portsIn.value:
position:absolute;z-index:9999;
height:80%;
width:80%;
font-family:CaveAt;
color:black;
font-weight:400;
font-size:24px;
padding:10%;
overflow-y: auto;
overflow-x: visible;

@import url('https://fonts.googleapis.com/css2?family=Quicksand&display=swap');
#paiper *{
    padding:0;
    margin:0;
    font-family: 'Quicksand', sans-serif;
}

#left{
position:relative;
z-index:1;
border:0;
width:50%;
float:left;
height:100%;
overflow:hidden;

}
#right{
z-index:1;
width:100%;
height:100%;
position:relative;
float:left;
overflow-y:auto;
overflow-x:visible;
}
#paiper span{
    z-index:2;
    font-size:12px;
    display:inline-block;
    margin:0;
    min-width:32px;
    max-width:118px;
    padding:5px 5px 10px 5px;
     cursor:text;
     color:rgba(255,255,255,.8);
     background-color:rgba(0,0,0,0.3);
     transition:box-shadow .2s ease-out;
     box-shadow: inset 6px 6px 10px rgba(0,0,0,.1);
     border-bottom:solid 1px rgba(255,255,255,.5);
     border-radius:16px;
     outline:none;
     color:black;
}
#paiper span:hover, #paiper span:focus{
 box-shadow: inset 2px 2px 3px rgba(0,0,0,.7); 
 border-bottom-right-radius:2px;
 color:white;
}
#paiper .cell{
    margin:0;
    padding:0;
    overflow:hidden;
    width:auto; height:auto;
    /*max-height:256px;*/
    pointer-events: auto; 
}
#paiper .text span, #paiper .console span{max-width:412px;}
.cell{
    border-radius:16px;
    transform-origin: top left;
    background-repeat: no-repeat;
    background-position:bottom 5px right 5px;
    background-size: 14px;

}
.chosen span, .cell:hover, .cell:active, .chosen{
    border-bottom-right-radius:2px;
}
.chosen{
    background-image:url('https://static.thenounproject.com/png/3187990-200.png');
}
#paiper .chosen span{
box-shadow: 4px 4px 4px rgba(0,0,0,.5); 
}
#paiper span::-webkit-scrollbar-thumb {
  background: rgba(255,255,255,.5);
  cursor:pointer;
}
#paiper span::-webkit-scrollbar-thumb:hover{
  cursor:pointer;
}
#paiper img{
    max-height:256px;
    max-width:256px;
    cursor:pointer;
}
#paiper .img{
    box-shadow: 4px 4px 4px rgba(0,0,0,.2);
}
#paiper .img:hover{
    box-shadow: 0 0 0 rgba(0,0,0,.9);
}
#paiper .cmd, #paiper .link{
z-index:3;
height:58px;width:58px;
cursor:pointer;
padding:3px;
word-break: break-word;
font-size:12px;
color:black;
background-color:#cbd0d6;
box-shadow: 6px 6px 2px rgba(0,0,0,.1);
transition:box-shadow .2s ease-out;
border-top:1px solid rgba(255,255,255,.5);
}
#paiper .cmd:hover, #paiper .memory:hover{
    box-shadow: 2px 2px 2px rgba(200,50,0,.5);
    background-color:orange;
    z-index:4;
}
#paiper .link:hover{
    box-shadow: 2px 2px 2px rgba(0,0,0,.2);
    z-index:4;
}#paiper .link:hover a{color:white;}
#paiper a{
    display:block;
    font-size:12px;
    color:black;
    pointer-events: none;
}
#paiper .memory{
    background-image: linear-gradient(to bottom right, blue, red);
    background-position:100% 100%;
    background-size:200%;
    transition:background-position .2 ease-out;
}#paiper .memory a{color:white;}


#paiper .emoji{
    font-size:22px;
    display:inline-block;
    background-color:transparent;
}
#paiper .emoji span{
    box-shadow:inset 8px 8px 8px rgba(0,0,0,0);
    cursor:pointer;
}
#paiper .emoji span:hover{
    box-shadow:inset 2px 2px 3px rgba(0,0,0,.5);
}
#paiper .cmd:hover, #paiper .link:hover{background-size:40%;font-weight:bold;}
#paiper .cmd.memories{
    background-size:100%;
    background-position:center;
    background-image:url('https://us.123rf.com/450wm/radistmorze/radistmorze1802/radistmorze180200119/95998040-vector-achtergrond-met-kleurruis-glitch-effect-.jpg?ver=6');
}
#paiper .cmd.memories:hover{background-size:200%;color:white;}
#paiper h1{
    font-size:42px;
    font-weight:200;
}
#paiper h2{
    font-size:14px;
    letter-spacing: 5px;
    text-transform: uppercase;
}
#paiper .console {font-size:22px;}
#paiper .memory:hover{
    box-shadow:2px 2px 0 rgba(255,100,0,1);
    background-position:0 0;
    font-weight:bold;
    background-size:100%;
}
#paiper .cmd{font-size:16px;}
#allboards{
    pointer-events: none; 
    min-height:100vh;
}
